const Product = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(
    (getProducts = async () => {
      fetch(`https://jsonplaceholder.typicode.com/posts`).then((response) =>
        setData(response)
      );
    }),
    []
  );

  return <div>{data}</div>;
};

export default Product;
